const RadioButton = ({name='radio', type='radio'}) =>{

    const [value, setValue] = useState(1);

    // const obj = {
    //     name_obj: 'Name',
    //     age: 12
    // }

    // const {name_obj, age} = obj;

    // console.log(name_obj)
